import React from 'react';
import './item.css';

const Item = (props) => { // Ensure props is passed as an argument
  return (
    <div className='item'>
      <Link to={'/product/${props.id}'}><img src={props.image} alt={props.name} /></Link>
      <p>{props.name}</p>
      <div className="item-prices">
        <div className="item-price-new">
          {props.new_price}
        </div>
        <div className="item-price-old">
          {props.old_price}
        </div>
      </div>
    </div>
  );
};

export default Item; // Export component with the correct name
